/**
 *
 * Importing all assets and exporting them as a single object.
 *
 */

import light_mode from "./light_mode.png";
import dark_mode from "./dark_mode.png";
import arrow_light from "./arrow_light.png";
import outline_light from "./outline_light.png";
import hero_text_light from "./hero-text_light.png";
import arrow_dark from "./arrow_dark.png";
import outline_dark from "./outline_dark.png";
import hero_text_dark from "./hero-text_dark.png";

export {
  light_mode,
  dark_mode,
  arrow_dark,
  arrow_light,
  outline_dark,
  outline_light,
  hero_text_dark,
  hero_text_light,
};
